import React from 'react';
import ReactDOM from 'react-dom';
import Magician from '../images/Wizard With Long Beard Design-01.png';

const SecondDiv = () =>{
    return(
        <div className="ui fluid container" style={{background: "linear-gradient(90deg, rgba(2,67,111,1) 0%, rgba(78,178,244,1) 35%, rgba(162,214,249,1) 100%)",height: "800px"}}>
            <center><img src={Magician} alt="Magician Photo" width="500" height="600" style={{marginTop:"100px"}}/></center>
        </div>
    );
};

export default SecondDiv;
